import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
// Use <React.StrictMode> during development to catch common mistakes and encourage best practices in your React codebase.
// It helps identify side effects, deprecated features, and potential performance optimizations.
// Note that <React.StrictMode> is primarily for development and debugging purposes and does not affect the behavior of your application in production.
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
